CREATE TABLE pessoa (
id SERIAL PRIMARY KEY,
nome VARCHAR(255),
cidade VARCHAR(255),
email VARCHAR(255),
cep VARCHAR(20),
endereco VARCHAR(255),
pais VARCHAR(100),
usuario VARCHAR(100),
telefone VARCHAR(20),
data_nascimento DATE,
cargo_id BIGINT
);


    -- 🔥 Ajuste da sequência após inserções manuais
SELECT setval('pessoa_id_seq', (SELECT MAX(id) FROM pessoa));